import React from "react";
import todoitem from "./Todoitem";
class Todos extends React.Component {
  render() {
    return this.props.mytodo.map(x => (
      <div>
        <h1>{x.Title}</h1>
        <h3>{x.Status ? "completed" : "Not completed"}</h3>
      </div>
    ));
  }
}
export default Todos;
